import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import '../directory/directory.style.css'

class Directory extends React.Component{
    constructor (props) {
  super();
 
  this.state = {
      sections :[
          {title: 'Hats',
          imageUrl : '/images/hats/3',
          id:1},
      
          {title: 'Jackets',
          imageUrl : <img src= "/images/jackets/3" alt="JACKETS"/> ,
          id:2},

         {title: 'Shoes',
         imageUrl :<img src= "/images/shoes/2" alt="SHOES" /> ,
         id:3},
         
         {title: 'MEN',
         imageUrl : <img src= "/images/models/1" alt="MEN" /> ,
          id:4},
         
         {title: 'WOMEN',
         imageUrl : <img src= "/images/models/4" alt="WOMEN" /> ,
         size:'large',
         id:5}
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({title,imageUrl,id}) => (
                <MenuItem key={id} title={title} imageUrl={imageUrl}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
